Голяма или малка кутия с вкусна и полезна храна? Туй е въпросът! 🤔
И ако вашите #зайчета не могат да изберат сами, помогнете им. Приятели, представяме ви новите #АбонаментниКутии от #ВълшебнатаГора 🌳 

📦 В малката кутия сме включили:
- Сушени зеленчуци;
- Сушени плодове;
- Сушени билки;
- Люцерново сено;
- Заешки бисквити.
👉 На специална цена от 90 лв.

📦 В голямата кутия ще откриете:
- Сушени зеленчуци;
- Сушени плодове;
- Сушени билки;
- Люцерново сено;
- Планинско билково сено;
- Заешки бисквити. 
👉 На специална цена от 187 лв.

Кутията е подходяща за зайчета, които се хранят натурално и са любители на нашите домашно приготвени лакомства. Може да направите своя абонамент сега и да получите желаната кутия на 1-во или 15-то число от следващия месец.

* Точните грамажи на включените артикули и цени ще откриете в снимките.

